import React, {FC} from 'react'

interface ButtonProps {
    disabled?: boolean;
    href?: string;
    onClick?: React.MouseEventHandler<HTMLButtonElement | HTMLAnchorElement>;
    styling?: Record<string, unknown>;
    children?: React.ReactNode;
    target?: string;
}

const Button: React.FunctionComponent<ButtonProps> = (props) => {
    return props.href ? (
        <Link href={props.href} onClick={props.onClick} styling={props.styling} children={children} disabled={disabled}/>
    ) : (
        <button
            disabled={props.disabled}
            onClick={props.onClick}
            style={styling}
        >
            {children}
        </button>
    )
}

const Link: React.FunctionComponent<ButtonProps> = ({
    href,
    children,
    onClick,
    styling,
    disabled
}) => {
    return (
        <a href={href} onClick={onClick} style={styling}>
            {children}
        </a>
    )
}

export default Button;
